import { Sidebar } from "../components/Sidebar";
import { Title } from "../components/Title";
import { UserRanked } from "../components/UserRanked";

export const Ranking = () => {
  const users = [
    {
        title: "Amet Mattis Vulputate", score: "60"
    }, {
        title: "Amet Mattis Vulputate", score: "50"
    }, {
        title: "Amet Mattis Vulputate", score: "40"
    }, {
        title: "Amet Mattis Vulputate", score: "30"
    }, {
        title: "Amet Mattis Vulputate", score: "20"
    }, {
        title: "Amet Mattis Vulputate", score: "10"
    }, {
        title: "Amet Mattis Vulputate", score: "5"
    },
]

  return (
    <div className="flex min-h-screen max-w-screen w-1/5 h-full">
      <Sidebar />

      <div className="w-4/5">
        <Title>Ranking</Title>
      </div>

      <div>
      {users.map(item => {
                    return (
                        <UserRanked title={item.name} score={item.desc} />
                    )
                })}
      </div>
    </div>
  );
};
